import React from 'react'
import './MovieRow.css'

export default ({title, items}) => {
    return (
        <div>
            <h2>{title}</h2>
 
            <div className="movieRow--listarea">
                {items.results.lengh > 0 && items.result.map((item, key)=>(
                    <img src = {`https://www.google.com/url?sa=i&url=https%3A%2F%2Femais.estadao.com.br%2Fnoticias%2Fcomportamento%2Ccaes-tem-curriculo-divulgado-no-linkedin-para-estimular-adocao%2C70003436973&psig=AOvVaw2BxyD1oxevb-sXjNWtv6YW&ust=1600368364352000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCOjRtPGq7usCFQAAAAAdAAAAABAD`} />
                ))}
            </div>
        </div>
        
    )
}
